$('#save').click(function (e) {
  e.preventDefault();
  $('.rotator').show();
  var name = $('input[name="name"]').val();
  var email = $('input[name="email"]').val();
  funs.saveEdit(name, email);
});
/*==================================================================
    [ change password ]*/

$('#editPassword').click(function (e) {
  e.preventDefault();
  $('.changePassword').show();
  $('#savePassword').show();
  $('#cancel2').show();
});
$('#savePassword').click(function (e) {
  e.preventDefault();
  var currentPassword = $('input[name="currentPassword"]').val();
  var newPassword = $('input[name="newPassword"]').val();
  var passwordConfirm = $('input[name="passwordConfirm"]').val();

  if (newPassword & newPassword === passwordConfirm) {
    funs.changePassword(currentPassword, newPassword, passwordConfirm);
  } else {
    alert('پسورد و تکرار پسورد یکسان نیستند');
  }
});
/*==================================================================
    [ password recovery ]*/

$('#passwordRecovery').click(function (e) {
  e.preventDefault();
  var email = $('input[name="email"]').val();
  funs.forgetPassword(email);
});
$('#resetPassword').click(function (e) {
  e.preventDefault();
  console.log('clicked on reset password button');
  var password = $('input[name="password"]').val();
  var passwordConfirm = $('input[name="passwordConfirm"]').val();

  if (!password || !passwordConfirm) {
    alert('پسورد و تکرار پسورد نمیتواند خالی باشد');
    return;
  }

  funs.resetPassword(token, password, passwordConfirm);
});
/*==================================================================
    [ cancel edit name and email and password]*/

$('#cancel1').click(function (e) {
  e.preventDefault();
  $('input[name="name"').prop('disabled', true);
  $('input[name="email"').prop('disabled', true);
  $('#save').hide();
  $('#cancel1').hide();
});
$('#cancel2').click(function (e) {
  e.preventDefault();
  $('.changePassword').hide();
  $('#savePassword').hide();
  $('#cancel2').hide();
});
/*==================================================================
    [ admin login]*/

$('#adminLogin').click(function (e) {
  e.preventDefault();
  console.log('it clicked');
  var email = $('input[name="email"]').val();
  var password = $('input[name="password"]').val();
  funs.adminLogin(email, password);
});
/*==================================================================
    [ God - edit user ]*/

$('#adminEditUser').click(function (e) {
  e.preventDefault();
  $('.adminEdit').prop('disabled', false);
  $('#adminSaveUser').show();
  $('#adminCancelSaveUser').show();
}); //---------

$('#adminCancelSaveUser').click(function (e) {
  e.preventDefault();
  $('.adminEdit').prop('disabled', true);
  $('#adminSaveUser').hide();
  $('#adminCancelSaveUser').hide();
}); //-----------

$('#adminSaveUser').click(function (e) {
  e.preventDefault();
  var list = ['bots', 'bills', 'services'];
  var id = $('input[name="_id"]').val();
  console.log('id: ', id);
  var user = {};
  $('.adminEdit').map(function () {
    var key = this.name;

    if (list.includes(key)) {
      user[key] = this.value.split(',').filter(function (el) {
        if (el !== ' ') return el;
      });
    } else {
      user[key] = this.value;
    }
  });
  console.log('user: ', user);
  funs.saveUser(user, id);
});
